searchData={"items":[{"type":"module","title":"Reality2Web.Schema","doc":"Reality2 GraphQL Schema\n\n  **Author**\n  - Dr. Roy C. Davies\n  - [roycdavies.github.io](https://roycdavies.github.io/)","ref":"Reality2Web.Schema.html"},{"type":"module","title":"Reality2Web.Schema.Sentant","doc":"Sentant Schema\n\n  Type definitions for the Sentant GraphQL schema are at: [Reality2.Types](../reality2/Reality2.Types.html)\n\n  **Author**\n  - Dr. Roy C. Davies\n  - [roycdavies.github.io](https://roycdavies.github.io/)","ref":"Reality2Web.Schema.Sentant.html"},{"type":"function","title":"Reality2Web.Schema.Sentant.sentant/0","doc":"Sentant Type\n\n```graphql\n  type Sentant {\n      id: UUID!                                   # The UUID of the sentant\n      name: String!                               # The name of the sentant\n      owner: User!                                # The owner of the sentant\n      data: JSON!                                 # The data on the sentant\n      automations: [Automation]!                  # The automations on the sentant\n      plugins: [Plugin]!                          # The plugins used by the sentant\n      node: Node                                  # The node the sentant is on\n  }\n```","ref":"Reality2Web.Schema.Sentant.html#sentant/0"},{"type":"module","title":"Reality2Web.UserSocket","doc":"","ref":"Reality2Web.UserSocket.html"},{"type":"function","title":"Reality2Web.UserSocket.connect/2","doc":"","ref":"Reality2Web.UserSocket.html#connect/2"},{"type":"function","title":"Reality2Web.UserSocket.id/1","doc":"","ref":"Reality2Web.UserSocket.html#id/1"}],"content_type":"text/markdown"}